import React, { Component } from 'react';
import './App.css';
import NavBar from "./pages/NavBar";
import SocialBar from "./pages/SocialBar";
import { BrowserRouter as Router, Switch, Route, Redirect} from 'react-router-dom';
import Main from "./pages/Main"



class App extends Component {

  render() {


    return (
      <div className="App">
      <Router>
        <div>
        <NavBar/>
        <SocialBar/>
          <Switch>
            <Route path="/videos/:id" render={ (props) => { return <Main {...props}  /> } }/>  
            <Route path="/videos" component={Main}/> 
            <Route path="/" render={ () => { return <Redirect to="/videos/1edc16bd-1bad-418b-bd40-c72ddd926672" />} } />  
        </Switch>
        </div>
      </Router>  
    </div>
    );
  }
}
export default App;
